import React from 'react';
import s from './Navbar.module.css'

const Navbar = (props) => {
    return (
        <navbar className={s.navbar}>
            <a className={s.logo} to={"/"}><span className={s.logoLetterE}>e</span>-board</a>
            <input type="text" value={'search'}/>
            <a className={`${s.btn} ${s.button}`}>Поиск</a>
            <a className={`${s.btn} ${s.button}`}>Разместить объявление</a>
            <span className={`${s.btn} ${s.buttonActive}`}>Войти</span>
        </navbar>
    );
};

export default Navbar;
